import React from 'react'
import Navbar from '../components/Navbar'

interface LayoutProps {
    children: React.ReactNode;
}

const Layout :React.FC<LayoutProps> = (props) => {
  return (
    <div>
        <Navbar/>
        {props.children}
    </div>
  )
}

export default Layout
